import React from 'react'
import { Map, GoogleApiWrapper } from 'google-maps-react';

const mapStyles = {
    width: '100%',
    height: '100%'
};

export default function Homepage() {
    return (
        <Map
          google={this.props.google}
          zoom={14}
          style={mapStyles}
          initialCenter={
            {
              lat: -1.2884,
              lng: 36.8233
            }
          }
        />
    );
}

GoogleApiWrapper({
  apiKey: 'AIzaSyAYnDuTTm9aZ7v2NV0hFtUwIoLb3S8WLvc'
});
